  'Accession number': 'Eingangsnummer',
  'The identification number assigned to a particular donation or acquisition of the analogue object.': 'Die Identifikationsnummer, die einer bestimmten Schenkung oder dem Erwerb des analogen Objekts zugewiesen wurde.',
  'Enter the identification number assigned to a particular donation or acquisition of the object.': 'Geben Sie die Identifikationsnummer ein, die einer bestimmten Schenkung oder dem Erwerb eines Objekts zugewiesen wurde.',
  'Associated with': 'In Verbindung mit',
  'The corporate body associated with the object.': 'Die mit dem Objekt verbundene Körperschaft.',
  'Specify the corporate body associated with your resource.': 'Geben Sie die Körperschaft an, die mit Ihrer Ressource verbunden ist.',
  'You have two options: you can select the value from the drop-down list, or you can click on the diagram icon on the right and navigate the organizational structure of the University of Vienna.': 'Sie haben zwei Möglichkeiten: Sie können den Wert aus der Dropdown-Liste auswählen oder Sie können auf das Diagrammsymbol rechts klicken und durch die Organisationsstruktur der Universität Wien navigieren.',
  'Tracking down people and institutions associated with the resource can be useful to allow reuse, especially if data has restricted access or it is no longer available. These are cases where human intervention is involved (e.g. sending an email to the metadata owner or calling to receive instructions). Fill in the field to provide an explicit contact in the metadata.': 'Das Finden von Personen und Institutionen, die mit der Ressource in Verbindung stehen, kann nützlich sein, um eine Wiederverwendung zu ermöglichen, insbesondere wenn der Zugang zu den Daten eingeschränkt ist oder sie nicht mehr verfügbar sind. Dies sind Fälle, in denen eine Aktion erforderlich ist (z. B. Senden einer E-Mail an den Eigentümer der Metadaten oder ein Anruf, um Nutzungshinweise zu erhalten). Füllen Sie das Feld aus, um einen konkreten Kontakt in den Metadaten anzugeben.',
  'Available language': 'Gesprochene Sprache',
  'An additional available language someone may use with audio and video resources.': 'Eine zusätzliche verfügbare Sprache, die in Audio- und Videoressourcen verwendet werden kann.',
  'Use this field when your resource can be additionally viewed, played, run, etc., in languages other than the main one.': 'Verwenden Sie dieses Feld, wenn Ihre Ressource zusätzlich in anderen Sprachen als der Hauptsprache angezeigt, abgespielt, ausgeführt usw. werden kann.',
