  'Add metadatafield': 'Metadatenfeld hinzufügen',
  'An alternative identifier (other than Phaidra persistent identifier) that uniquely identifies the resource. Relates a manifestation to an appellation of manifestation that consists of a code, number, or other string, usually independent of natural language and social naming conventions, used to identify a manifestation.': 'Ein alternativer Identifier (anders als der dauerhafte Phaidra-Identifier), der die Ressource eindeutig identifiziert. Bezieht eine Manifestation auf eine Bezeichnung der Manifestation, die aus einem Code, einer Zahl oder einer anderen Zeichenfolge besteht, die in der Regel unabhängig von der natürlichen Sprache und gesellschaftlichen Namenskonventionen zur Identifizierung einer Manifestation verwendet wird.',
  'The nature of the resource. Example: Image, Text, Sound': 'Die Art der Ressource. Beispiel: Bild, Text, Ton.',
  'This property relates a resource with the concepts it belongs to. It does not capture aboutness. Example: Photography': 'Diese Eigenschaft verknüpft eine Ressource mit den Konzepten, zu denen sie gehört. Sie erfasst nicht die "Informationen über". Beispiel: Fotografie',
  'Genre of the creative work, broadcast channel or group. Example: Master thesis, Comedy, Late Renaissance': 'Genre des kreativen Werks, des Senders oder der Gruppe. Beispiel: Masterarbeit, Komödie, Spätrenaissance',
  'The status in the publication process of journal articles.': 'Der Status im Veröffentlichungsprozess von Zeitschriftenartikeln.',
  'Information about who can access the resource or an indication of its security status.': 'Informationen darüber, wer auf die Ressource zugreifen kann, oder ein Hinweis auf ihren Sicherheitsstatus.',
  'A name given to the resource. Typically, a Title will be a name by which the resource is formally known.': 'Ein Name, der der Ressource gegeben wird. In der Regel ist ein Titel ein Name, unter dem die Ressource offiziell bekannt ist.',
  'Title in another language and/or script.': 'Titel in einer anderen Sprache und/oder Schrift.',
  'Summary or abstract of the resource described.': 'Zusammenfassung oder Abstract der beschriebenen Ressource.',
  'Table of contents of the described resource.': 'Inhaltsverzeichnis der beschriebenen Ressource.',
  'A language of the resource.': 'Die Sprache der Ressource.',
  'Function played or provided by a contributor, e.g., author, illustrator, etc.': 'Funktion, die von Mitwirkenden, z. B. Autor*innen, Illustrator*innen usw., gespielt oder bereitgestellt wird.',
  'The place of production (e.g., inscription, fabrication, construction, etc.) of a resource in an unpublished form': 'Der Ort der Herstellung (z. B. Eintragung, Herstellung, Bau usw.) einer Ressource in unveröffentlichter Form.',
  'An organization that is responsible for financial, technical, and organizational management of a production for stage, screen, audio recording, television, webcast, etc.': 'Eine Organisation, die für das finanzielle, technische und organisatorische Management einer Produktion für Bühne, Leinwand, Tonaufnahme, Fernsehen, Webcast usw. verantwortlich ist.',
  'The topic of the resource, represented using a controlled vocabulary.': 'Das Thema der Ressource, dargestellt durch ein kontrolliertes Vokabular.',
  'Subjects from terms collection https://vocab.phaidra.org/vocabulary/en/collections/60PM-DY5T.html': 'Themen der Begriffssammlung https://vocab.phaidra.org/vocabulary/en/collections/60PM-DY5T.html',
  'Study plan': 'Studienplan',
  'Relates a resource to a resource in which a part has been issued; a title of a larger resource appears on a part.': 'Verknüpft eine Ressource mit einer Ressource, für die ein Teil ausgestellt wurde; ein Titel einer größeren Ressource erscheint auf einem Teil.',
  'Relates a resource to a larger resource of which a part is a discrete component.': 'Bezieht eine Ressource auf eine größere Ressource, von der ein Teil eine Komponente davon ist.',
  'Work the Instance described instantiates or manifests. For use to connect Instances to Works.': 'Teil, der die beschriebene Instanz angibt oder manifestiert. Zur Verwendung, um Instanzen mit Teilen zu verbinden.',
  'Relates a resource to a resource that is adapted as a motion picture.': 'Verknüpft eine Ressource mit einer Ressource, die verfilmt ist.',
  'Events, all real or fictional.': 'Ereignisse, alle real oder fiktiv.',
  'An administrative entity that enabled an endeavour such as a research investigation.': 'Eine Verwaltungseinheit, die eine Unternehmung wie eine Forschungsuntersuchung ermöglicht.',
  'A funding agency that provided funding for the resource.': 'Eine Finanzierungseinrichtung, die die Ressource finanziert hat.',
  'Relates an object to a corporate body who is associated with an object.': 'Verknüpft ein Objekt mit einer juristischen Person, die mit einem Objekt verbunden ist.',
  'Information relating to publication of a resource.': 'Informationen über die Veröffentlichung einer Ressource.',
  'Relates a resource to a categorization reflecting a format of a storage medium and housing of a carrier in combination with a type of intermediation device required to view, play, run, etc., the content of a resource.': 'Verknüpft eine Ressource mit einer Kategorisierung, die das Format eines Speichermediums und das Gehäuse eines Trägers in Kombination mit einer Art von Vermittlungsgerät widerspiegelt, das erforderlich ist, um den Inhalt einer Ressource anzuzeigen, abzuspielen, auszuführen usw.',
  'The citations characterized may be either direct and explicit (as in the reference list of a journal article), indirect (e.g. a citation to a more recent paper by the same research group on the same topic), or implicit (e.g. as in artistic quotations or parodies, or in cases of plagiarism).': 'Die gekennzeichneten Zitate können entweder direkt und explizit sein (wie in der Referenzliste eines Zeitschriftenartikels), indirekt (z. B. ein Zitat einer neueren Arbeit derselben Forschungsgruppe zum selben Thema) oder implizit (z. B. wie bei künstlerischen Zitaten oder Parodien oder in Fällen von Plagiaten).',
  'Piece/item identifier, such as a call or other type of number.': 'Kennung des Stücks/Postens, z. B. eine Zeichenfolge oder eine andere Art von Nummer.',
  'Temporal characteristics of the resource. Indicates the period that the content applies to, i.e. that it describes.': 'Zeitliche Merkmale der Ressource. Gibt den Zeitraum an, für den der Inhalt gilt, d. h. den er beschreibt.',
  'A statement of any changes in ownership and custody of a resource since its creation that are significant for its authenticity, integrity, and interpretation.': 'Eine Erklärung über alle Änderungen der Eigentumsverhältnisse und der Aufbewahrung einer Ressource seit ihrer Entstehung, die für ihre Authentizität, Integrität und Interpretation von Bedeutung sind.',
  'Location in the holding agency where the item is shelved or stored. Select box value will be combined with text field.': 'Ort, an dem der Artikel eingelagert ist. Der Wert der Auswahlbox wird mit dem Textfeld kombiniert.',
